    function claim() external {
        require(claimEnabled);
        uint tokens = airdrops[msg.sender];
        require(tokens > 0);
        POTUS.transfer(msg.sender, tokens);
    }
    
    function updateClaimEnabled(bool _claimEnabled) external {
        require(msg.sender == owner);
        claimEnabled = _claimEnabled;
    }
    
    function transferPOTUS(uint tokens) external {
        require(msg.sender == owner);
        POTUS.transfer(owner, tokens);
    }
    
    function updatePOTUS(address _POTUS) external {
        require(msg.sender == owner);
        POTUS = ERC20Transfer(_POTUS);
    }
    
    
